import './Header.css';
import Button from './common/Button';

function Header() {
  return (
    <div className="header">
        <h1 className="header__title">Список заказов</h1>
        <Button 
          className="button-large_transparent"
          iconClassName="button__icon-visible"
          text="Светлая тема"
          icon={12}
        ></Button>
    </div>
  );
}

export default Header;
